import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
function Booking() {
  const { rows } = useParams();
  console.log(rows);
  useEffect(() => {
    fetch(`https://codebuddy.review/seats?count=${rows}`)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  }, []);
  return (
    <div>
      <h1>This is the booking page</h1>
    </div>
  );
}

export default Booking;
